  false,\n\t\"url\": null,\n\t\"notes\": \"On September 25, 2013, New York City released
  the 2012 energy and water use data for all properties required to annually benchmark
  under Local Law 84. New York City is the first in the nation to publicly disclose
  data for large multifamily buildings. Approximately a million New Yorkers can now
  see how much energy and water their apartment buildings consumed in 2012.rnrnThe
  new data set includes more than 9,000 self-reported multifamily properties, effectively
  more than tripling the size of the first year's list. The data also represents the
  first year's results of both manual and automatic water benchmarking, with more
  than 6,800 properties reporting water data.\",\n\t\"license_title\": \"License Not
